import axios from 'axios';
import VueAxios from 'vue-axios';

Vue.use(VueAxios, axios);

// Возможно, также у вас есть базовая настройка URL для API
axios.defaults.baseURL = 'http://localhost:3000/api'; // Замените на ваш URL API
